import React from 'react'

const  WrongLetters = () => {
    return(
        <>
            <div className="wrong-letters-container">
                <div>
                    {wrongLetters.length > 0 ? '<p>Wrong</p>' : ''}
                    {wrongLetters.map((letter, i) => <span key={i}>{letter}</span>)}
                </div>
            </div>
        </>
    )
}

export default WrongLetters;
